import prestataireToolbar from "@/components/prestataires/prestataireToolbar.vue";
import prestataireSignupManege from "@/components/prestataires/prestataireSignupManege.vue";
import axios from "axios";
export default {
  name: "prestataireManegeSignup",
  components: {
    prestataireToolbar,
    prestataireSignupManege
  },
  data: () => {
    return {
      id_user: null,
      id: null,
      registered: null,
      emplacements: null,
      manege: null
    };
  },
  mounted() {
    this.id_user = this.$store.state.user.id;
    this.id = this.$route.params.id;
    axios({
      method: 'get',
      url: 'http://localhost:3000/prestataires/' + this.id_user + '/manege/' + this.id + '/signup'
    }).then(result => {
      this.registered = result.data.data.alreadyRegistered;
      this.emplacements = result.data.data.emplacements;
      this.manege = result.data.data.manege;
    }).catch(error => {
      console.log(error);
    });
  }
};
